import React from 'react';

import SiteNavbar from './SiteNavbar';
import SiteNavbarMobile from './mobile/SiteNavbarMobile';
import Footer from './Footer';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Development = () => {
	const large = matchMedia('(max-width: 992px)');
	let Navbar = SiteNavbar;
	if (large.matches) {
		Navbar = SiteNavbarMobile;
	}
	return (
		<div className="development">
			<Navbar />
			<Container fluid className="body" style={{ paddingTop: '15vh' }}>
				<Row>
					<Col xs={12} className="text-center">
						<h1 className="header">
							<span style={{ textShadow: 'none' }}>Education With </span>
							Application.
						</h1>
					</Col>
				</Row>
				<Row>
					<Col xs={12} className="text-center">
						<p
							style={{
								color: 'black',
								fontSize: '26px',
								letterSpacing: '.14em',
								lineHeight: '136%',
								padding: '4vh 10% 7vh 10%',
							}}
						>
							In our Development branch, we connect experienced web developers
							to Bay Area startups. Students will partake in the software
							engineering lifecycle, leading the design, build, and deployment
							stages of the client's website.
						</p>
					</Col>
				</Row>
			</Container>
			<Footer />
		</div>
	);
};

export default Development;
